INSERT INTO `plage` (`id_plage`, `nom_plage`, `description_plage`, `photo_plage`, `nom_categorie`) VALUES
(1, 'Plages Frontignan', 'Au nord de Sète, Frontignan offre 7 km de plages de sable et de galets dont certaines dans un environnement préservé. Le canal du Rhône à Sète passe par cette station balnéaire.', 'frontignan.JPEG', 'plage'),
(2, 'Plages Cap d''Agde', 'Le Cap d’Agde est l’une des stations balnéaires du Languedoc Roussillon les plus fréquentées. Avec ses 14 km de plages de sable fin et ses nombreuses attractions, elle attire de nombreux touristes en été.', 'agde.JPEG', 'plage'),
(3, 'Plages La Grande-Motte', 'Située au sud de Montpellier, La Grande Motte est la station la plus moderne du Languedoc Roussillon avec ses immeubles en Pyramide. De belles plages de sable s’étendent sur 8 km.', 'motte.JPEG', 'plage'),
(4, 'Plages Sète', 'Plus grand port de pêche de France, Sète possède également 12 km de plages de sable fin accessible par une bande de terre étroite (lido) entre l’étang de Thau et la Méditerranée.', 'sete.JPEG', 'plage'),
(5, 'Plages Carnon', 'Située entre La Grande-Motte et Palavas-les-Flots, la station balnéaire de Carnon-Plage est la station la plus proche de Montpellier. 7 km de plages de sable fin.', 'carnon.JPEG', 'plage'),
(6, 'Plages Palavas-les-Flots', 'A 13 km au sud-ouest de Montpellier, Palavas-les-Flots propose de nombreuses plages de sable avec des activités pour les enfants directement sur le sable.', 'palavas.JPEG', 'plage'),
(7, 'Plages Marseillan', 'Située à proximité du Cap d''Agde, la petite station balnéaire de Marseillan-Plage offre plusieurs kilomètres de sable fin et de nombreuses activités en été.', 'marseillan.JPEG', 'plage'),
(8, 'Plages Vias', '5 km de plages de sable fin à l''ouest du Cap d''Agde avec le canal du midi qui passe à proximité. C''est ce que propose Vias-Plage dans l''Hérault.', 'vias.JPEG', 'plage'),
(9, 'Plages Grau d''Agde', 'A 9 km à l''ouest du Cap d''Agde, la station balnéaire du Grau d''Agde propose 3 plages de sable de part et d''autre du fleuve de l''Hérault.', 'grau.JPEG', 'plage'),
(10, 'Plages Balaruc-les-Bains', 'Située au bord de l''étang de Thau,à seulement quelques kilomètres de la Méditerranée, Balaruc les Bains est une destination thermale et balnéaire avec 3 plages de sable.', 'balaruc.JPEG', 'plage'),
(11, 'Plages Portiragnes\r\n', 'Petite station balnéaire de l''Hérault, Portiragnes offre près de 2 km de plages de sable fin avec un bel espace dunaire isolant totalement les plages du centre-ville. Zone préservée.', 'portiragnes.JPEG', 'plage'),
(12, 'Plages Sérignan', 'Sérignan se situe à l''ouest de l''Hérault dans la périphérie de Béziers. Une grande plage dans une zone préservée (réserve naturelle) est disponible. Nombreux campings.', 'serignan.JPEG', 'plage'),
(13, 'Plages Villeneuve-lès-Maguelone', 'Villeneuve-lès-Maguelone offre l’une des plages les plus sauvages de l’Hérault dans un environnement vierge de toute construction.', 'maguelone.JPEG', 'plage'),
(14, 'Plages Valras-Plage', 'Port de pêche et de plaisance, Valras-Plage se transforme l’été en station balnéaire grâce à son longue plage de sable où l’on trouve de nombreuses animations.', 'valras.JPEG', 'plage'),
(15, 'Plages Vendres', 'Longue étendue de sable dans un environnement préservé, Vendres-Plage a gardé un littoral sauvage (seulement des campings en bord de mer, non visible depuis la plage).', 'vendres.JPEG', 'plage');
